import Board from "./components/Board";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact>
          <PostList />
        </Route>
        <Route path="postform" exact>
          <PostForm />
        </Route>
        <Route path="/board/id">
          <BoardDetails />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
